import * as React from "react";
import classNames from "classnames";
import Img from "public/img/抽屉.png";
import { Context } from "./FloatingBoll";

// 定义类名前缀
const prefix = 'SnowBoll';
const componentsPrefix = prefix + '-' + 'floating-boll';

export interface FunctionBollProps {
    size?: 'small' | 'middle' | 'large';
    mainImg?: string;
    customStyle?: React.CSSProperties;
    parent?: boolean;
    order?: number;
    method?: string | object;
}

function translateWay(direction: string, order: number, size: string, distance: number) : string {
    const size_map : {[index: string]:number} = {
        'small': 15,
        'middle': 25,
        'large': 35
    };
    const base_dis:number = distance + size_map[size];
    const way_map : {[index: string]:string} = {
        'up': `translateY(${base_dis*order})`,
        'down': `translateY(-${base_dis*order})`,
        'left': `translateX(-${base_dis*order})`,
        'right': `translateX(${base_dis*order})`,

    };
    return way_map[direction];asd
}

export const FunctionBoll : React.FunctionComponent<FunctionBollProps> = (props: FunctionBollProps) => {
    const context = React.useContext(Context);
    let {
        size = 'middle',
        mainImg = Img,
        customStyle = {},
        direction = 'up',
        distance = 10
    } = context;

    const className = classNames([
        `${componentsPrefix}-${size}`,
        componentsPrefix,
    ]);

    customStyle = {
        ...customStyle,
        backgroundImage: `url(${mainImg})`,
        transition: `translate ${props.order * 0.5}s`,
        visibility: 'hidden',
        transform: translateWay(direction, props.order, size, distance)
    }


    return (
        <div className={className} style={customStyle}>
        </div>
    )

};
